import React , { Component } from 'react';
import './App.css';
import Home from './components/Home/Home'
import Card from './components/Card/Card'


class App extends Component{
  render(){
  return (
    <div className="App">
      <header className="App-header">
       <Home></Home>
       <Card></Card>
      </header>
    </div>
  );
}
}
export default App;
